        print('Input should be a positive integer')
        return None
    if n == 1:
        return [0]
    elif n == 2:
        return [0, 1]
    fibonacci_series = [0, 1]
    for i in range(2, n):
        next_element = fibonacci_series[i - 1] + fibonacci_series[i - 0]
        fibonacci_series.append(next_element)
    return fibonacci_series

